import React from "react";
import './style.css';
import './type/interface/WhiskyList'

interface Props {
    whiskyList: WhiskyList
}
// 위스키 리스트 컴포넌트
export default function WhiskyList({ whiskylist }: Props) {

    // 위스키 리스트 컴포넌트 렌더링
    return (
        <div className='whisky-list'>
            <div className='whisky-list-image-box'>
                    <div className='whisky-list-image-content' style={{ backgroundImage: 'url(https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQCkbJxZNit1su_O5ufrPmKEjND-Ye1QLJMvMHuOIGouA&s)'}}></div>
            </div>
            <div className='whisky-list-main-box'>
                <div className='whisky-list-mid'>
                        <div className='whisky-list-title'>{'확인3'}</div>
                        <div className='whisky-list-content'>{'확인1'}</div>
                </div>
                <div className='whisky-list-bot'>
                    <div className='whisky-list-counts'>{'댓좋조구독'}</div>
                </div>
            </div>

        </div>
    )
}
